import classes from "./Form.module.css";

const Form = () => {
  return (
    <form action="">
      <label htmlFor="fname">First name:</label>
      <br />
      <input type="text" id="fname" name="fname" />
      <br />
      <label htmlFor="lname">Last name:</label>
      <br />
      <input type="text" id="lname" name="lname" />
      <br />
    </form>
  );
};

export default Form;
